  false,\n\t\"url\": null,\n\t\"notes\": \"The purpose of this Environmental Assessment
  is to evaluate the feasibility of removing portions of the North Platte National
  Wildlife Refuge from the National Wildlife Refuge System. This environmental assessment
  (EA) evaluates current management (No Action) and three alternative actions for
  recreation on the Lake Minatare Unit to help accomplish the major purposes for which
  the refuge was established. The purpose is to determine if the wildlife values of
  the Lake Minatare Unit are of sufficient values to retain it or parts of it for
  a National Wildlife Refuge. This considered action is being made due to low wildlife
  values of several areas and the funds required to manage them, and the fact these
  low wildlife values provide nothing significant towards the achieving refuge or
  the National Refuge System purposes and goals. The need for this action is to reduce
  the amount of funds this station spends on areas ofnlow value to wildlife and wildlife
  orientated recreation.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
